  // public/mockups/src/js/dom-helpers.js
  var $ = (id) => document.getElementById(id);
  function getElCenter(viewport, id) {
    const el = typeof id === "string" ? $(id) : id;
    if (!el) return { x: 450, y: 300 };
    const vr = viewport.getBoundingClientRect();
    const er = el.getBoundingClientRect();
    return {
      x: er.left - vr.left + er.width / 2,
      y: er.top - vr.top + er.height / 2
    };
  }
  function moveCursor(cursor, x, y) {
    cursor.style.left = x + "px";
    cursor.style.top = y + "px";
  }
  function moveToEl(viewport, cursor, id) {
    const pos = getElCenter(viewport, id);
    moveCursor(cursor, pos.x, pos.y);
  }
  function clickEffect(cursor) {
    cursor.classList.add("clicking");
    setTimeout(() => cursor.classList.remove("clicking"), 400);
  }
  function wait(ms) {
    return new Promise((r) => setTimeout(r, ms));
  }
  function slowScroll(el, target, duration) {
    return new Promise((resolve) => {
      const start = el.scrollTop;
      const distance = target - start;
      const startTime = performance.now();
      function step(now) {
        const elapsed = now - startTime;
        const progress = Math.min(elapsed / duration, 1);
        const ease = progress < 0.5 ? 2 * progress * progress : 1 - Math.pow(-2 * progress + 2, 2) / 2;
        el.scrollTop = start + distance * ease;
        if (progress < 1) requestAnimationFrame(step);
        else resolve();
      }
      requestAnimationFrame(step);
    });
  }

  // public/mockups/src/js/ui-state.js
  function showCv(id) {
    document.querySelectorAll(".cv-area").forEach((el) => el.classList.add("hidden"));
    $(id).classList.remove("hidden");
  }
  function updateStepIndicator(step, stepLabels2) {
    document.querySelectorAll(".step-dot").forEach((dot) => {
      const s = parseInt(dot.dataset.step);
      dot.classList.remove("active", "done");
      if (s === step) dot.classList.add("active");
      else if (s < step) dot.classList.add("done");
    });
    const label = $("step-label");
    if (label) label.textContent = `\xC9tape ${step} \u2014 ${stepLabels2[step]}`;
  }
  function setCvIcon(type) {
    const img = $("cv-icon-img");
    if (type === "gpt") {
      img.src = ICON_OPENAI_SYMBOL;
    } else if (type === "analyzer") {
      img.src = ICON_ANALYZER;
    } else {
      img.src = ICON_IMPORT;
    }
  }
  async function typeText(el, text, speed) {
    for (let i = 0; i <= text.length; i++) {
      el.textContent = text.substring(0, i);
      await wait(speed);
    }
  }
  function animateCounter(el, from, to, duration) {
    const start = performance.now();
    function tick(now) {
      const elapsed = now - start;
      const progress = Math.min(elapsed / duration, 1);
      const eased = 1 - Math.pow(1 - progress, 3);
      el.textContent = Math.round(from + (to - from) * eased);
      if (progress < 1) requestAnimationFrame(tick);
    }
    requestAnimationFrame(tick);
  }

